import React, { Component } from "react";
import Link from "next/link";

function Navbar() {
  return (
    <Nav style={NavbarStyle}>
      <h1>Todo List</h1>
      <ul>
            <li><Link href="/"><a>Home</a></Link></li>
            <li><Link href="/about"><a style={linkstyle}>About</a></Link></li>
        </ul>
    </Nav>
  )
}

export default Navbar;
